import React, { useEffect } from 'react';
import apicidades from '../../services/apicidades';

export default function Detail() {
    useEffect(() => {
        const response = apicidades.get();
        console.log(response);
    }, [])
    return(
        <div>
            <h1>My Detail</h1>
        </div>
    );
}
